import React, {useState} from 'react';
import {
  SafeAreaView,
  ScrollView,
  Text,
  View,
  Alert,
  StyleSheet,
  Button,
} from 'react-native';
import {enhetApi} from './api';

const App = () => {
  const [names, setNames] = useState([]);
  const [schools, setSchools] = useState({})
  const [status, setStatus] = useState('Ingen skoler hentet')
  const [statusNavn, setNavnstatus] = useState('')
  const [selectedSchool, setSelectedSchool] = useState('')
  const [info, setInfo] = useState('')


  const getSchools = async () => {

    try {
      const fetchedgschool = await enhetApi.getEnheterEndretEtterDato('1800.01.01');
      setSchools(fetchedgschool.data.filter(function(item) {
        if(item.ErGrunnskole == true || item.ErVideregaaendeSkole == true){
          return item;
        }
      }).map(function({Navn, Orgnr, Kommunenr, Fylkesnr}) {
        setStatus('Skoler tilgjengelig, hent navn')
        return {Navn, Orgnr, Kommunenr, Fylkesnr}
      }));


    } catch (error) {
      console.warn(error)
      Alert.alert('An error occurred');
    }


  };


  const addNames = () => {
    for(let i = 0; i < Object.keys(schools).length;) {
      names.push(schools[i]["Navn"])
      i += 1
    }
    setNavnstatus('Navn er hentet nå')
  }

  const selectChange = (event: React.ChangeEvent<HTMLSelectElement>) => {
    const value = event.target.value

    for(let i = 0; i < Object.keys(schools).length;) {
      if(schools[i]["Navn"] == value.toString()) {
        setInfo(schools[i])
      }
      i += 1
    }


    setSelectedSchool(value)
  }

  return (
    <SafeAreaView>
      <ScrollView>
        <View>
          <Button title="Hent skoler" onPress={() => getSchools()} />
          <Button title="Skole navn" onPress={() => addNames()} />

          <select onChange={selectChange}>
                {names.map(name => {
                  return (
                    <option value={name}>{name}</option>
                  )
                }
              )}

          </select>
          <Text style={styles.schools}>{status}</Text>
          <Text style={styles.schools}>{statusNavn}</Text>
          <Text style={styles.schools}>{selectedSchool}</Text>
          <Text style={styles.schools}>{info}</Text>


        </View>
      </ScrollView>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  button: {
    padding: 20,
    margin: 20,
    borderWidth: 4,
    borderColor: '#000',
    borderRadius: 10,
  },
  buttonText: {
    fontSize: 24,
    fontWeight: '900',
  },
  schools: {
    fontSize: 18,
    padding: 10,
    marginTop: 10,
  },
});

export default App;
